import React from "react";
import profilePic from "../images/IMG_4334.jpg";

const About = () => {
  return (
    <div className="h-screen py-10 ">
      <h1 className="text-4xl dark:text-white text-black font-bold font-merriweather text-center">
        About Myself
      </h1>
      <div className="flex">
        <div>
          <img
            width={300}
            src={profilePic}
            alt="My profile picture"
            className="relative md:left-32 md:top-32"
          />
        </div>
        <div class="w-1/2 ml-60 inline-block ">
          <h1
            className="text-xl dark:text-white text-black font-merriweather"
          >
            Hi! I'm Bara. I am a second year undergrad student at the University
            of Toronto. I am currently pursuing a double major in Computer
            Science and Human Biology. My interests include reading, playing
            sports and working out.
          </h1>
        </div>
      </div>
    </div>
  );
};

export default About;
